import React, { useState } from 'react';
import {
    Text,
    View,
    Image,
    TouchableOpacity,
    TextInput,
    ScrollView,
    FlatList
} from "react-native";
import Icon from 'react-native-vector-icons/FontAwesome5';

import { images, colors, icons, fontSizes, data } from '../../constants';
import { isValidEmail, isValidPassword } from '../../util/Validations';

function ProductGridView(props: any) {
    return (
        <View
            style={{
                flex: 1,
                backgroundColor: 'white'
            }}
        >
            <Text>This is ProductGridView</Text>
        </View>
    )
}

export default ProductGridView;
